import { MenuBook, AddToDriveOutlined } from '@mui/icons-material';
import {
  AppBar,
  Box,
  Toolbar,
  IconButton,
  List,
  ListItemButton,
  ListItemIcon,
  ListItemText,
} from '@mui/material';
import { minWidth } from '@mui/system';
// sx={{}}
const Header = () => {
  return (
    <>
      <AppBar sx={{ position: 'sticky' }}>
        <Toolbar
          sx={{
            display: 'flex',
            justifyContent: 'space-between',
            width: '100%',
          }}>
          <Box sx={{ flex: 1 }}>Logo</Box>
          <Box sx={{ flex: 1 }}>
            <List
              sx={{
                display: 'flex',
                justifyContent: 'center',
              }}>
              <ListItemButton component='a'>
                {/* <ListItemIcon>
                  <AddToDriveOutlined />
                </ListItemIcon> */}
                <ListItemText
                  sx={{ display: 'flex', listStyle: 'none' }}
                  primary='movies'
                />
              </ListItemButton>

              <ListItemButton component='a'>
                {/* <ListItemIcon>
                  <AddToDriveOutlined />
                </ListItemIcon> */}
                <ListItemText
                  sx={{ display: 'flex', listStyle: 'none' }}
                  primary='series'
                />
              </ListItemButton>
              <ListItemButton component='a'>
                {/* <ListItemIcon sx={{ padding: '5px' }}>
                  <AddToDriveOutlined />
                </ListItemIcon> */}
                <ListItemText
                  sx={{ display: 'flex', listStyle: 'none' }}
                  primary='search'
                />
              </ListItemButton>
            </List>
          </Box>

          <Box>
            <IconButton>
              <MenuBook sx={{ sm: { display: 'none' } }} />
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
